                  "text": "\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 38.72 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 4224 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 50.67 s &lt;/li&gt;\n&lt;li&gt; transfer time: 10.92 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.12.206.63:33863 &lt;/li&gt;\n          &lt;li&gt; Workers: 19 &lt;/li&gt;\n          &lt;li&gt; Threads: 19 &lt;/li&gt;\n          &lt;li&gt; Memory: 442.32 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nyears = [1, 5, 10, 20, 30, 40, 50, 60]\n\ndf = pd.DataFrame()\n\nwith performance_report(filename=\"timeseries-computation.html\"):\n    for year in years:\n        print(f'Starting year {year}')\n        # Compute without computation\n        wall_time = test_timeseries_file(year)\n        df = df.append(\n            {\n                'catalog': 'timeseries',\n                'computation': 'file_access',\n                'num_years': year,\n                'wall_time': wall_time,\n            },\n            ignore_index=True,\n        )\n\n        # Compute with long-term mean computation\n        wall_time = test_timeseries_file(year, long_term_average=True)\n        df = df.append(\n            {\n                'catalog': 'timeseries',\n                'computation': 'long_term_average',\n                'num_years': year,\n                'wall_time': wall_time,\n            },\n            ignore_index=True,\n        )\n\n        # Compute with long-term mean computation\n        wall_time = test_timeseries_file(year, monthly_average=True)\n        df = df.append(\n            {\n                'catalog': 'timeseries',\n                'computation': 'monthly_average',\n                'num_years': year,\n                'wall_time': wall_time,\n            },\n            ignore_index=True,\n        )\ndf_timeseries = df\n\n        &lt;/pre&gt;\n        "
